window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"18.0.0","implementation":{"name":"cucumber-jvm","version":"7.4.1"},"runtime":{"name":"Java HotSpot(TM) 64-Bit Server VM","version":"17.0.9+11-LTS-201"},"os":{"name":"Windows 10"},"cpu":{"name":"amd64"},"ci":{"name":"Jenkins","url":"http://localhost:8080/job/com.LoanTechExperTeam01_smoke_e2e/38/","buildNumber":"38","git":{"remote":"https://github.com/ramazanE56/com.LoanTechExperTeam01.git","revision":"bb64ff68da8251a91ee195c9883ab37befa62e98"}}}},{"testRunStarted":{"timestamp":{"seconds":1703288337,"nanos":578741200}}},{"source":{"uri":"file:///C:/Users/asus/IdeaProjects/com.LoanTechExperTeam01/src/test/resources/features/US12_Ismail.feature","data":"\r\nFeature: I would like to have a page to register as a visitor\r\n\r\n  Background:Users use these steps to log in to the site.\r\n\r\n    * The visitor enter site given \"Url\"\r\n\r\n\r\n  @smoke\r\n  Scenario: TC01 : It must be verified that the Get Started Button Link is visible and active on the Home Page.\r\n\r\n    * Verify that the Get Started Button link is Visible on the Home Page\r\n    * Click on the Get Started Button on the Home Page.\r\n    * Verify that the register text is visible on register page.\r\n    * Close the page\r\n\r\n\r\n  @e2e\r\n  Scenario: TC02 : Verify that the registration form is visible on the registration page\r\n    * Click on the Get Started Button on the Home Page.\r\n    * Verify that the Welcome To Loantech Expert form title is visible on the Register page\r\n    * Close the page\r\n\r\n\r\n  Scenario: TC03 : It must be verified that the Username, Email Address, Country DropDown,\r\n            Mobile Number, Password, Confirm Password text boxes are visible in the form.\r\n\r\n    * Click on the Get Started Button on the Home Page.\r\n    * Verify that the username text box is visible\r\n    * Verify that the Email Address text box is visible\r\n    * Verify that the Country DropDown is visible\r\n    * Verify that the Mobile Number text box is visible\r\n    * Verify that the Password text box is visible\r\n    * Verify that the Confirm Password text box is visible\r\n    * Close the page\r\n\r\n\r\n  Scenario: TC04 : It must be verified that a unique value of at least 6 characters can be entered in the Username box.\r\n\r\n    * Click on the Get Started Button on the Home Page.\r\n    * A unique username with at least 6 characters is entered in the Username box.\r\n    * Close the page\r\n\r\n\r\n  Scenario: TC05 : It must be verified that valid e-mail information containing\r\n            the @ sign can be entered in the e-mail text box.\r\n\r\n    * Click on the Get Started Button on the Home Page.\r\n    * A unique username with at least 6 characters is entered in the Username box.\r\n    * It is verified that valid e-mail information containing the @ sign can be entered in the e-mail text box\r\n    * Close the page\r\n\r\n\r\n  Scenario: TC06 : It must be verified that country selection is possible from the Country menu.\r\n\r\n    * Click on the Get Started Button on the Home Page.\r\n    * A unique username with at least 6 characters is entered in the Username box.\r\n    * Valid e-mail information containing the @ sign is entered into the e-mail text box\r\n    * It is verified that country selection is possible from the Country menu.\r\n    * Close the page\r\n\r\n\r\n  Scenario: TC07 : It must be verified that country selection is possible from the Country menu.\r\n\r\n    * Click on the Get Started Button on the Home Page.\r\n    * A unique username with at least 6 characters is entered in the Username box.\r\n    * Valid e-mail information containing the @ sign is entered into the e-mail text box\r\n\r\n\r\n    * Country selection is made from the Country menu.\r\n    * It is verified that a unique phone number of up to 14 digits can be entered in the phone textbox.\r\n    * Close the page\r\n\r\n\r\n  Scenario: TC08 : It must be verified that a 6-digit password containing at least\r\n            one uppercase letter, one number, lowercase letter and character can be entered in the\r\n            Password textbox and that the entered password can be hidden or unlocked.\r\n\r\n    * Click on the Get Started Button on the Home Page.\r\n    * A unique username with at least 6 characters is entered in the Username box.\r\n    * Valid e-mail information containing the @ sign is entered into the e-mail text box\r\n    * Country selection is made from the Country menu.\r\n    * A unique phone number of maximum 14 digits is entered into the phone textbox.\r\n    * It is verified that a 6-digit password containing at least one uppercase letter, one number, lowercase letter and character can be entered in the Password textbox.\r\n    * It is verified that the password entered in the password textbox can be hidden or revealed.\r\n    * Close the page\r\n\r\n\r\n  Scenario: TC009 : It must be verified that the password specified in the Confirm textbox can be re-entered.\r\n\r\n    * Click on the Get Started Button on the Home Page.\r\n    * A unique username with at least 6 characters is entered in the Username box.\r\n    * Valid e-mail information containing the @ sign is entered into the e-mail text box\r\n    * Country selection is made from the Country menu.\r\n    * A unique phone number of maximum 14 digits is entered into the phone textbox.\r\n    * A 6-digit password containing at least one uppercase letter, one number, lowercase letter and character is entered into the Password textbox.\r\n    * It is verified that the password specified in the Confirm textbox can be entered again.\r\n    * Close the page\r\n\r\n\r\n  Scenario: TC10 : Verify that the 'I agree with Privacy Policy, Terms of Service, Rapid Policy' check box is clickable\r\n\r\n    * Click on the Get Started Button on the Home Page.\r\n    * Verify that the I agree with Privacy Policy, Terms of Service, Rapid Policy check box is clickable\r\n    * Close the page\r\n\r\n\r\n  Scenario: TC11 : By clicking on the Register button, the user registration form must\r\n            be submitted and it must be verified that it can be directed to the User Data page to complete the registration.\r\n\r\n    * Click on the Get Started Button on the Home Page.\r\n    * A unique username with at least 6 characters is entered in the Username box.\r\n    * Valid e-mail information containing the @ sign is entered into the e-mail text box\r\n    * Country selection is made from the Country menu.\r\n    * A unique phone number of maximum 14 digits is entered into the phone textbox.\r\n    * A 6-digit password containing at least one uppercase letter, one number, lowercase letter and character is entered into the Password textbox.\r\n    * The specified password is entered in the Confirm textbox.\r\n    * click on the i agree button\r\n    * click on the register button\r\n    * Verify that Please Complete Your Profile is visible\r\n    * Close the page\r\n\r\n\r\n    Scenario: TC12 : It appears in the form opened on the User Data page\r\n              (firstname, lastname, address, State, Zip, city, Submit Button) and must be verified as active.\r\n\r\n      * Click on the Get Started Button on the Home Page.\r\n      * A unique username with at least 6 characters is entered in the Username box.\r\n      * Valid e-mail information containing the @ sign is entered into the e-mail text box\r\n      * Country selection is made from the Country menu.\r\n      * A unique phone number of maximum 14 digits is entered into the phone textbox.\r\n      * A 6-digit password containing at least one uppercase letter, one number, lowercase letter and character is entered into the Password textbox.\r\n      * The specified password is entered in the Confirm textbox.\r\n      * click on the i agree button\r\n      * click on the register button\r\n      * The Firstname box should be visible\r\n      * The lastname box should be visible\r\n      * The address box should be visible\r\n      * The State box should be visible\r\n      * The Zip box should be visible\r\n      * The city box should be visible\r\n      * The Submit Button should be visible\r\n      * Submit Button must be clickable\r\n      * Close the page\r\n\r\n\r\n    Scenario: TC13 : It must be verified that the registration process\r\n              can be completed by filling in the mandatory fields in the form (firstname/lastname/address textboxes).\r\n\r\n      * Click on the Get Started Button on the Home Page.\r\n      * A unique username with at least 6 characters is entered in the Username box.\r\n      * Valid e-mail information containing the @ sign is entered into the e-mail text box\r\n      * Country selection is made from the Country menu.\r\n      * A unique phone number of maximum 14 digits is entered into the phone textbox.\r\n      * A 6-digit password containing at least one uppercase letter, one number, lowercase letter and character is entered into the Password textbox.\r\n      * The specified password is entered in the Confirm textbox.\r\n      * click on the i agree button\r\n      * click on the register button\r\n      * Name is entered in the firstname box\r\n      * Surname is entered in the lastname box\r\n      * Address is entered in the address box\r\n      * State is entered in the state box\r\n      * zip code entered in zip code box\r\n      * Country is entered in the city box\r\n      * Click on the submit button\r\n      * Verify that registration process completed successfully appears\r\n      * Close the page\r\n\r\n\r\n\r\n\r\n\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/asus/IdeaProjects/com.LoanTechExperTeam01/src/test/resources/features/US12_Ismail.feature","feature":{"location":{"line":2,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"I would like to have a page to register as a visitor","description":"","children":[{"background":{"location":{"line" aw button is clicked, it should redirect to the \"Withdraw Money\" page.\r\n\r\n      * Verify that the withdraw button is visible and active\r\n      * Click the withdraw button\r\n      * Verify the Withdraw Money text is visible on page\r\n\r\n     Scenario: TC_02 Method name must be selected from the \"Method\" dropdown menu.\r\n\r\n      * Click the withdraw button\r\n      * Verify that the Method Text is visible on page\r\n      * Verify that the all option is visible\r\n\r\n     Scenario: TC_03 A value between 300.00 USD - 8000.00 USD should be entered in the Amount textbox.\r\n\r\n       * Click the withdraw button\r\n       * Select the Method5 Updated on Method Dropdown menu\r\n       * Write the 350 USD On Amount textbox,\r\n       * Verify that after the amount value limit text will be visible\r\n\r\n     Scenario: TC_04 When the Submit button is clicked, the text \"Withdraw Via Method 5 Updatedé\" should be displayed.\r\n\r\n       * Click the withdraw button\r\n       * Select the Method5 Updated on Method Dropdown menu\r\n       * Write the 350 USD On Amount textbox,\r\n       * Verify that after the amount value limit text will be visible\r\n       * Click the Submit button on withdraw section\r\n       * Verify that Withdraw Via Method5 Updated section is displayed\r\n\r\n     Scenario: TC_05 The Submit button should be clickable and the text \"Withdraw request sent successfully\" should be displayed.\r\n\r\n       * Click the withdraw button\r\n       * Select the Method5 Updated on Method Dropdown menu\r\n       * Write the 350 USD On Amount textbox,\r\n       * Click the Submit button on withdraw section\r\n       * Verify that submit button is visible and active\r\n       * Click the Submit button on withdraw method section\r\n       * Verify that Withdraw request sent successfully message is appeared\r\n\r\n     Scenario: TC_06 The withdrawal made on the Withdraw History page must be visible in the accordion table.\r\n\r\n       * Click the withdraw button\r\n       * Select the Method5 Updated on Method Dropdown menu\r\n       * Write the 350 USD On Amount textbox,\r\n       * Click the Submit button on withdraw section\r\n       * Click the Submit button on withdraw method section\r\n       * Verify that Withdraw History page is visible\r\n\r\n     Scenario: TC_07 Charge-After Charge-Conversion-Status values should be displayed in a selected withdrawal transaction in the accordion table.\r\n\r\n       * Click the withdraw button\r\n       * Select the Method5 Updated on Method Dropdown menu\r\n       * Write the 350 USD On Amount textbox,\r\n       * Click the Submit button on withdraw section\r\n       * Click the Submit button on withdraw method section\r\n       * Click the table name on Withdraw History page\r\n       * Verify that the charge-after charge-conversion-status is visible for each transaction\r\n\r\n     Scenario: TC_08 When you click on the \"Withdraw Money\" button on the Withdraw History page, you should go to the \"Withdraw Money\" page.\r\n\r\n       * Click the withdraw button\r\n       * Select the Method5 Updated on Method Dropdown menu\r\n       * Write the 350 USD On Amount textbox,\r\n       * Click the Submit button on withdraw section\r\n       * Click the Submit button on withdraw method section\r\n       * Click the Withdraw Money button on withdraw History page\r\n       * Verify that Withdraw Money text is visible\r\n@e2e\r\n     Scenario: TC_09 When you click on the \"Withdraw Log\" button on the \"Withdraw Money\" page, you should go to the Withdraw History page.\r\n\r\n       * Click the withdraw button\r\n       * Select the Method5 Updated on Method Dropdown menu\r\n       * Write the 350 USD On Amount textbox,\r\n       * Click the Submit button on withdraw section\r\n       * Click the Submit button on withdraw method section\r\n       * Click the Withdraw Money button on withdraw History page\r\n       * Click the Withdraw Log button on withdraw Money page\r\n       * Verify that Withdraw History text is visible\r\n\r\n\r\n\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/asus/IdeaProjects/com.LoanTechExperTeam01/src/test/resources/features/US17_Omer.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"US_17 As a registered user, I would like to have a page to manage my payment transactions.","description":"","children":[{"background":{"location":{"line":3,"column":3},"keyword":"Background","name":"Users use these steps to log in to the site.","description":"","steps":[{"location":{"line":4,"column":5},"keyword":"* ","text":"The user enters site with the given \"Url\"","id":"a0c0efc0-22c2-480d-b014-76d10daca7d4"},{"location":{"line":5,"column":5},"keyword":"* ","text":"Accept the cookies on page","id":"e375c0dc-d782-4e36-8d9e-3ac09c30cd61"},{"location":{"line":6,"column":5},"keyword":"* ","text":"Login with registered user information","id":"66da6585-5947-433e-8dee-77d02a7d75c5"}],"id":"c59a47f9-5d4d-4a82-b5eb-5024b5a68ccd"}},{"scenario":{"location":{"line":8,"column":6},"tags":[],"keyword":"Scenario","name":"TC_01 - TC_02 There should be a \"Withdraw\" button on the Dashboard page to manage withdrawals.","description":"              WhenN the Withdraw button is clicked, it should redirect to the \"Withdraw Money\" page.","steps":[{"location":{"line":11,"column":7},"keyword":"* ","text":"Verify that the withdraw button is visible and active","id":"6169b11c-222c-4dde-8522-2a09f7ac6fe4"},{"location":{"line":12,"column":7},"keyword":"* ","text":"Click the withdraw button","id":"49019c21-f8ce-469e-aa6b-c4981dc57b7c"},{"location":{"line":13,"column":7},"keyword":"* ","text":"Verify the Withdraw Money text is visible on page","id":"7a8dbea9-cab9-4e2d-824e-60b4de675507"}],"examples":[],"id":"05fc46a4-1ef9-4f70-be6c-9ed20cbba5d2"}},{"scenario":{"location":{"line":15,"column":6},"tags":[],"keyword":"Scenario","name":"TC_02 Method nam
